package esercizio3;

public class Balance {

	private int p;
	private int w;

	Balance() {
	}

	public boolean setBalanceValue(int x, int y) {
		this.p = x;
		this.w = y;

		if ((p < 4 && w <= 400) || (p == 0 && w <= 1000))
			return true;
		else {
			return false;
		}
	}

	public int getP() {
		return p;
	}

	public int getW() {
		return w;
	}
}

package esercizio4;

public class Magazzino {

	private int[] product = new int[5]; // Rappresenta i 5 prodotti, da 0 a 4

	public Magazzino() {
		for (int i = 0; i < 1; i++) {
			product[i] = 0;
		}
	}

	/**
	 * @param productIndex l'indice del prodotto al quale aggiungere addQuantity
	 * @param addQuantity  la quantità da aggiungere al prodotto productIndex
	 * @return true se l'inserimento è avvenuto, false altrimenti
	 */
	public boolean insert(int productIndex, int addQuantity) {
		if ((productIndex < 0 || productIndex > 4) || (addQuantity < 0 || addQuantity > 10)
				|| (product[productIndex] + addQuantity) > 100) {
			return false;
		} else {
			product[productIndex] += addQuantity;
			return true;
		}
	}

	/**
	 * @param productIndex l'indice del prodotto che voglio controllare
	 * @return false se l'indice non è corretto o il magazzino non è pieno, true
	 *         altrimenti
	 */
	public boolean isFull(int productIndex) {
		if (productIndex < 0 || productIndex > 4)
			return false;
		else
			return product[productIndex] == 100 ? true : false;
	}

	/**
	 * @return true se il magazzino è pieno, false altrimenti
	 */
	public boolean isFull() {
		int total = 0;
		for (int i = 0; i < 5; i++)
			total += product[i];
		return total == 500 ? true : false;
	}
}

package esercizio5;

import static org.junit.Assert.*;
import org.junit.Test;
/**
 * The Class RedCarExitTest. Scenario in cui la macchina esce
 */
public class RedCarExitTest {
	
	@Test
	public void test() {
		RushHour puzzle = new RushHour();
		//sposto la macchina 4 verso sinistra
		assertTrue(puzzle.moveCar(3,5,4));
		//sposto la macchina 3 verso il basso
		assertTrue(puzzle.moveCar(2,5,3));
		//sposto la macchina rossa (1) verso destra per tre volte
		assertTrue(puzzle.moveCar(2,2,2));
		assertTrue(puzzle.moveCar(2,3,2));
		assertTrue(puzzle.moveCar(2,4,2));
		//controllo se la macchina rossa è all'uscita
		assertTrue(puzzle.redCarAtExit());
	}

}
